import * as types from "./types"
import { shakebook } from '@/service/api/v1/account_pb'
import { manager } from "@/service/api/v1/manager_pb";
const initialState: types.RoleState = {
  roleList: []
}

function reducer(
  state: types.RoleState = initialState,
  action: any
): types.RoleState {
  console.log(action.account);
  switch (action.type) {

    case types.GET_ROLE_LIST:
      const a = action as types.GetRoleListAction
      return {
        ...state,
        roleList: [...a.data!],
      }
    default:
      return state
  }
}


export default reducer;
